#include <iostream>
#include <string.h>
using namespace std;
class Solution 
{
   bool is_vald(const string &s) {
    bool seen[256] = {false}; // For all ASCII characters
    for (char ch : s) {
        if (seen[(unsigned char)ch])
            return false;
        seen[(unsigned char)ch] = true;
    }
    return true;
}

public:
    int lengthOfLongestSubstring(string s) 
    {
        int save_i = 0;
        string c;
        for (int i = 0; i < s.size(); i++)
        {
            c = "";
           for (int j = i; j < s.size(); j++)
           {
                c += s[j];
                if (!is_vald(c))
                {
                  //  cout <<"in| "<< c << endl;
                    break;
                }
                if (is_vald(c) && save_i < c.size())
                    save_i = c.size();
           }
           
        }
        
       return save_i;
    }
  
};

